// src/pages/Signup.js
import React from 'react';
import '../css/login.css'; // 기존 스타일 그대로 사용

function Signup() {
  return (
    <div className="login-container">
      <h1 className="spotlight-logo">
        <span className="black">SPOT</span>
        <span className="light animated">LIGHT</span>
      </h1>

      <div className="signup-box">
        <h2>가입을 시작합니다!</h2>
        <div className="highlight-box">SPOTLIGHT 회원가입하기</div>
      </div>
    </div>
  );
}

export default Signup;
